		static class LKMPigJsonStorage extends LKMPig.LKMPigStorage {

		    static final String LOADER_FUNCTION = "JsonLoader";
		    static final String STORAGE_FUNCTION = "JsonStorage";

            private String pigSchema;

		    static List<LKMPig.FunctionParam> FUNCT_ARG = new ArrayList<LKMPig.FunctionParam>(1);

		    static {
		        FUNCT_ARG.add(new LKMPig.FunctionParam(LKMPig.LKMPigStorage.OPTION_PIG_SCHEMA));
		    }

		    @Override
		    String getLoaderFunction() {
		        return LOADER_FUNCTION;
		    }

		    @Override
		    String getStorerFunction() {
		        return STORAGE_FUNCTION;
		    }

		    @Override
		    List<LKMPig.FunctionParam> getLoaderFunctionParams() {
		        return FUNCT_ARG;
		    }

            @Override
            void populateLoaderFunctionParams(PigLoadCmd loadCmd) throws AdapterException,
                                                               GenerationException,
                                                               oracle.odi.domain.mapping.exception.MappingException {
                 pigSchema = loadCmd.getParentScript().getOutputSchema().getSchemaDefinition(false);                                                                
		         super.populateLoaderFunctionParams(loadCmd);
                 loadCmd.setGenerateInputSchemaDefinition(false);
            }
		    @Override
		    String handleFunctionParam(LKMPig.FunctionParam param,
		                             String value,
		                             boolean isLoader) throws AdapterException,
		                                          oracle.odi.domain.mapping.exception.MappingException {


		        if (param.name.equals(LKMPig.LKMPigStorage.OPTION_PIG_SCHEMA)) {
		            return pigSchema;
		            //return getSchema();
		        }
		        return value;
		    }

		    String getSchema() {

			       String cValue = getOptionValue("Schema for Complex Fields"); 
		            if (cValue == null || cValue.equals("")) {
		                return super.getSchema();
		            } else {

                        Map<String, String> complexFields = null;  
                        try {
		                    complexFields = new LKMPig.ComplexSchemaParser().getComplexyFields(cValue);
                        } catch (IllegalArgumentException e) {
                            throw new IllegalArgumentException("Illegal Value for 'Schema for Complex Fields' : "+cValue);
                        }
                        String schema = super.getSchema(complexFields);
                        if (!complexFields.isEmpty()) {
                            throw new IllegalArgumentException("Unknown fields "+complexFields.keySet()+" specified for 'Schema for Complex Fields' : "+cValue);
                        }
                        return schema;
		            }
		    }


		} 		

