		static class LKMPigPigStorage extends LKMPig.LKMPigStorage {

		    static final String STORAGE_FUNCTION = "PigStorage";
		    static List<LKMPig.FunctionParam> FUNCT_ARG = new ArrayList<LKMPig.FunctionParam>(1);
		    static List<LKMPig.FunctionOption> LOAD_FUNCT_OPTIONS = new ArrayList<LKMPig.FunctionOption>(1);
		    static List<LKMPig.FunctionOption> STORE_FUNCT_OPTIONS = new ArrayList<LKMPig.FunctionOption>(1);


		    static {
		        FUNCT_ARG.add(new LKMPig.FunctionParam("Field Delimiter"));
		        LOAD_FUNCT_OPTIONS.add(new LKMPig.FunctionOption("No Schema", "noschema"));
		        //LOAD_FUNCT_OPTIONS.add(new LKMPig.FunctionOption("Tag Path", "tagPath"));
		        //LOAD_FUNCT_OPTIONS.add(new LKMPig.FunctionOption("Tag File", "tagFile"));

		        STORE_FUNCT_OPTIONS.add(new LKMPig.FunctionOption("Store Schema", "schema"));
		    }

		    @Override
		    String getLoaderFunction() {
		        return STORAGE_FUNCTION;
		    }

		    @Override
		    String getStorerFunction() {
		        return STORAGE_FUNCTION;
		    }

		    @Override
		    List<LKMPig.FunctionParam> getLoaderFunctionParams() {
		        return FUNCT_ARG;
		    }

		    @Override
		    List<LKMPig.FunctionParam> getStorerFunctionParams() {
		        return FUNCT_ARG;
		    }

		    @Override
		    List<LKMPig.FunctionOption> getLoaderFunctionOptions() {
		        return LOAD_FUNCT_OPTIONS;
		    }

		    @Override		
		    List<LKMPig.FunctionOption> getStorerFunctionOptions() {
		        return STORE_FUNCT_OPTIONS;
		    }


		    @Override
		    String handleFunctionParam(LKMPig.FunctionParam param,
		                               String value,
		                               boolean isLoader) throws AdapterException,
		                                          oracle.odi.domain.mapping.exception.MappingException {


		        if (param.name.equals("Field Delimiter")) {
			        oracle.odi.domain.model.OdiDataStore dataStore = (oracle.odi.domain.model.OdiDataStore)dataStoreNode.getLogicalComponent().getBoundObject();

				if (dataStore == null || dataStore.getFileDescriptor() == null) {
                                        return ","
                                }
                                else {

                                        String separator = dataStore.getFileDescriptor().getFieldSeparator();
                                        if (separator.trim().equals("\\u0009"))
                                             return "\\t";

                                        return separator;
                                }

		        }
		        return value;
		    }
		}

