		static class LKMPigCustomStorage extends LKMPig.LKMPigStorage {

		    static final String STORAGE_FUNCTION = "CustomStorage";
		    static List<LKMPig.FunctionParam> FUNCT_ARG = new ArrayList<LKMPig.FunctionParam>(1);
		    static List<LKMPig.FunctionOption> FUNCT_OPTIONS = new ArrayList<LKMPig.FunctionOption>(1);

		    String functionClass;
		    String jars;
		    static {
		        FUNCT_ARG.add(new LKMPig.FunctionParam("Function Class"));
		        FUNCT_ARG.add(new LKMPig.FunctionMultiParam("Function Parameters"));
		        FUNCT_ARG.add(new LKMPig.FunctionParam("Function Parameter Builder Class"));
		        FUNCT_ARG.add(new LKMPig.FunctionParam("Jars"));
		        FUNCT_OPTIONS.add(new LKMPig.FunctionOption("Options", null));
		    }

		    private String getFunctionClass() {
		    	if (functionClass == null) {
		       		throw new RuntimeException("Function Class can not be empty for a Custom Storage function");
		        } 

		    	return functionClass;
		    }

		    @Override
		    String getLoaderFunction() {
		        return getFunctionClass();
		    }

		    @Override
		    String getStorerFunction() {
		        return getFunctionClass();
		    }

		    @Override
		    List<LKMPig.FunctionParam> getLoaderFunctionParams() {
		        return FUNCT_ARG;
		    }

		    @Override
		    List<LKMPig.FunctionParam> getStorerFunctionParams() {
		        return FUNCT_ARG;
		    }

		    @Override
		    List<LKMPig.FunctionOption> getLoaderFunctionOptions() {
		        return FUNCT_OPTIONS;
		    }

		    @Override		
		    List<LKMPig.FunctionOption> getStorerFunctionOptions() {
		        return FUNCT_OPTIONS;
		    }

		    @Override
		    String handleFunctionParam(LKMPig.FunctionParam param,
		                             String value,
		                             boolean isLoader) throws AdapterException,
		                                          oracle.odi.domain.mapping.exception.MappingException {


		        if (param.name.equals("Function Class")) {
		            functionClass = value;   
		        }		        
		        else if (param.name.equals("Jars")) {
		            jars = value;   
		        }
		        else if (param.name.equals("Function Parameter Builder Class")) {
		            if (value == null) return null; 

		            try {
			            Class<?> builderClass = Class.forName(value);
			            java.lang.reflect.Method method = builderClass.getMethod("build",  [MapPhysicalNode.class] as Class[]);
			            int modifier = method.getModifiers();
			            Object instance = null;
			            if (!java.lang.reflect.Modifier.isStatic(modifier)) {
			                instance = c.newInstance();
			            }

			            return (String)method.invoke(instance, [physicalNode] as Object[]);

			        } catch (Exception e) {

			            throw new oracle.odi.domain.mapping.exception.MappingException("Unable to invoke the method 'build(MapPhysicalNode)' in class '"+value+"'", e);
			        }   
		        }

		        return null;
		    }    


		    @Override 
		    void addPigCommands(PigCommand pigCommand) {


		       if (jars != null && !jars.equals("")) {

		       		String[] rjars = jars.split(",");
		       		for (String rjar : rjars) { 
		       		    rjar = rjar.trim();
		       		    if (!rjar.equals("")) {
		       		    	pigCommand.addRegisterPath(rjar);
		       			}
		       		}
		    	}

		    }
		}

 		//class LKMPigCustomStorage End 		
